import React from "react";
import './styles/footer.css'

function Footer() {
  return (
    <footer className="footer font-small  bg-dark text-white">
      <div className="text-center p-2">
        Test FrontEnd Developer Footer
        <p>Diego Betancourt</p>
      </div>
    </footer>
  );
}

export default Footer;
